TESTING NOTE: You can find examples to testing Leptos code from the 'examples' directory of the Leptos repository here - https://github.com/leptos-rs/leptos/tree/main/examples Test Business Logic With Ordinary Rust Tests In many cases, it makes sense to pull the logic out of your components and test it separately. For some simple componenents, ther's no particular logic to test, but for many it's worth using a testable wrapping type and implementing the logic in ordinary Rust impl blocks. Example code; pub struct Todos(Vec<Todo>); impl Todos { pub fn num_remaining(&self) -> usize { todos.iter().filter(|todo| !todo.completed).sum() }
} #[cfg(test)]
mod tests { #[test] fn test_remaining() { // ... }
} #[component]
pub fn TodoApp() -> impl IntoView { let (todos, set_todos) = create_signal(Todos(vec![Todo { /* ... */ }])); // ✅ this has a test associated with it let num_remaining = move || todos.with(Todos::num_remaining);
} In general, the less of your logic is wrapped into your components themselves, the more idiomatic your code with feel and the easier it will be to test. Test Components With End-to-End (e2e) Testing wasm-bindgen-test with counter example; #[wasm_bindgen_test]
