} Take note that <Suspense></Suspense> would keep flickering its fallback if you keep reloading the data, as in, each time any one of its embedded create_resource dep signal changes. To avoid this flickering, consider using a <Transition></Transition> instead. <Transition></Transition> behaves exactly as <Suspense></Suspense>, but instead of falling back every time, it only shows the fallback the first time. On all subsequent loads, it continues showing the old data until the new data are ready. This can be really handy to prevent the flickering effect, and to allow users to continue interacting with your application. Code example; let (count_a, set_count) = create_signal(0);
