&gt;&gt;&gt;&gt;&gt;&gt;&gt; main C- SIGNALS BASICS Creating a signal in Leptos; let ( {{signal_name}}, {{set_signal_name}} ) = create_signal( {{intial-value}} ) Reading a signal syntax <button /*...*/> "Click me: " {count} </button> // The value will evaluate and dynamically change per signal change OR <button /*...*/> "Click me: " {count()} </button> Update a signal dynamically <button on:click=move |_| { set_count.update(|n| *n += 1); }> "Click me: " {move || count()} </button> D- DERIVED SIGNALS FOR DYNAMICALLY DERIVED VALUES Derived signals are controlled by signals. Signals are functions, e.g, the single tuple value returned from 'create_signal()' contains two elements and each elements are the signals. Derived signals on the other hand, are closures which access a signal. Derived signal syntax // double_count is a derived signal
let double_count = move || count() * 2; OR <progress max="50" value=move || count() * 2 // value is subtly a derived signal
/> Derived signal usage example // First create a Read & Write signal
let (count, set_count) = create_signal(0);
/* Then create a closure that calls a Read signal to clone its value, and returns a double of the value as a variable
*/
let double_count = move || count() * 2; view! { // An HTML element with an attribute whose value dynamically changes <progress max="50" value=double_count /> // Another example <p> "Double Count: " {double_count} </p>
} Speaking of derived signals, you can use them to create; dynamic HTML values dynamic event-listeners updates dynamic class values dynamic inline-style values & dynamic HTML attribute values Derived signals compute twice or more times. A derived signal will run once for the variable that stores, and once for/inside each and every place where the variable that stores it is used. Use memos for resource intensive values that need to change like a signal. E- DYNAMIC CLASSES, HTML ATTRIBUTES & INLINE STYLES Dynamic class' syntax <p class:red=move || count() % 2 == 1> "Dynamically change the color of this text" </p> OR /* Use this approach if your HTML element has a class name with one or more dashes in its definition */ class=("button-20", move || count() % 2 == 1) Dynamic HTML attribute syntax <progress max="50" value=move || count() * 2 // value is subtly a derived signal
/> Dynamic inline-style syntax // First create a signal that would control the value fo the style
let (o, set_o) = create_signal(0);
let (p, set_p) = create_signal(0);
view! { <div style="position: absolute" // Now create dynamic style style:left=move || format!("{}px", o() + 100) style:top=move || format!("{}px", p() + 100) style:background-color=move || format!("rgb{}, {}, 100)", o() p()) style=("--columns", x) > "Moves when coordinates change" </div>
} F- HTML INJECTION You can inject HTML directly into a DOM element or Component's render using the inner_html Leptos property like this; let html = "<p>This HTML will be injected.</p>";
view! { <div inner_html=html/>
}

