BUILDING USER INTERFACES::
COMPONENTS, SUB-COMPONENT PROPS (Part 1). See Part 2 here Specifying a component prop for a sub-component looks like this; #[component]
fn {{TheNameOfTheSubComponent}}( {{the_name_of_prop_1}}: {{its_data_type}} // e.g, progress: ReadSignal<i32>
) -> impl IntoView { view! { <progress max="50" value={{the_name_of_prop_1}} /> }
} // And here is how you would use such component with a property
#[component]
fn App() -> impl IntoView { let (count, set_count) = create_signal(0); view! { <{{TheNameOfTheSubComponent}} {{the_name_of_prop_1}}=count/> }
} Optional Sub-component Prop Specifying an optional component prop for a sub-component looks like this; #[component]
fn {{TheNameOfTheSubComponent}}( // You need the '#[prop(optional)]' annotation #[prop(optional)] {{the_name_of_optional_prop_1}}: {{its_data_type}}
) -> impl IntoView { view! { <progress max="14" value={{the_name_optional_prop_1}} /> }
} // And here is how you would use such component with a property
#[component]
fn App() -> impl IntoView { view! { <{{TheNameOfTheSubComponent}}/> // notice how {{the_name_of_optional_prop_1}} was entirely skipped! }
} Optional Sub-component Prop With Default Value Specifying an optional component with a default value when skipped for a sub-component; #[component]
fn {{TheNameOfTheSubComponent}}( // You need the '#[prop(optional)]' annotation #[prop(default = 20)] {{the_name_of_optional_prop_1}}: {{its_data_type}}
) -> impl IntoView { view! { <progress max={{the_name_of_optional_prop_1}} value="14" /> }
} // And here is how you would use such component with a property
#[component]
fn App() -> impl IntoView { view! { <{{TheNameOfTheSubComponent}}/> // ** notice how {{the_name_of_optional_prop_1}} was entirely skipped! }
} Generic Sub-component Prop Specifying a generic sub-component prop lets you use a value that is of a certain data-type such as, and i32, or use a closure that returns a value of the same data-type (i32). Here is a (trait-style) demonstration of specifying a generic sub-component prop; #[component]
fn {{TheNameOfTheSubComponent}}<F>( {{the_name_of_prop_1}}: F
) -> impl IntoView
where F: Fn() -> i32 + 'static, // "F: impl F() -> i32 + 'static " not allowed in Leptos yet
{ view! { <progress max="14" value={{the_name_of_prop_1}} /> }
} // Usage:
#[component]
fn App() -> impl IntoView { let (count, set_count) = create_signal(0); // count is an i32 type of value let double_count = move || { count() * 2 }; // double_count is closure that returns an i32 type of value view! { <{{TheNameOfTheSubComponent}} {{the_name_of_prop_1}}=count/> // direct value of type i32 <{{TheNameOfTheSubComponent}} {{the_name_of_prop_1}}=double_count> // closure that evaluates to a value of type i32 }
} Here is an (attribute-style) demonstration of specifying a generic sub-component prop; #[component]
fn {{TheNameOfTheSubComponent}}( #[prop(into)] {{the_name_of_prop_1}}: Signal<i32>
) -> impl IntoView
{ view! { <progress max="14" value={{the_name_of_prop_1}} /> }
} // Usage:
#[component]
fn App() -> impl IntoView { let (count, set_count) = create_signal(0); // count is an i32 type of value let double_count = move || { count() * 2 }; // double_count is closure that returns an i32 type of value view! { <{{TheNameOfTheSubComponent}} {{the_name_of_prop_1}}=count/> // direct value of type i32 // ** Take Note Here ** <{{TheNameOfTheSubComponent}} {{the_name_of_prop_1}}=Signal::derive(double_count)/> // closure that evaluates to a value of type i32 }
} Optional Generic Sub-component Prop Usually, you can't specify optional generic props for a sub-component, but there is a workaround for this, which is Option<Box<dyn Fn() -> {{DataType}}>>. Example code; #[component]
fn {{TheNameOfTheSubComponent}}( {{the_name_of_optional_generic_prop_1}}: Option:<Box<dyn Fn() -> i32>>, // change i32 to your desired data-type
) -> impl IntoView { {{the_name_of_optional_generic_prop_1}}.map( |{{optional_generic_prop_1_value}}| { view! { <progress max="14" value={{optional_generic_prop_1_value}} /> } })
} // Usage:
#[component]
fn App() -> impl IntoView { let (count, set_count) = create_signal(3); // count is an i32 type of value let double_count = move || { count() * 2 }; // double_count is closure that returns an i32 type of value view! { // ** providing no optional generic prop <{{TheNameOfTheSubComponent}}/> // ** providing the optional generic prop as an i32 type <{{TheNameOfTheSubComponent}} {{the_name_of_optional_generic_prop_1}}=count/> // ** providing the optional generic optional prop as a double type <{{TheNameOfTheSubComponent}} {{the_name_of_optional_generic_prop_1}}=double_count/> }
} Documenting Components Here is a demonstration of how you would document components. It is very simple. You do so with three slashes, as in, ///. /// Shows progress toward a goal.
#[component]
fn ProgressBar( /// The maximum value of the progress bar. #[prop(default = 100)] max: u16, /// How much progress should be displayed. #[prop(into)] progress: Signal<i32>,
